import {LOGIN, REGISTER, LOADING} from "./AuthConstants";


export const loginAction = (data) => ({ type: LOGIN, payload: data });
export const registerAction = (data) => ({ type: REGISTER, payload: data });
export const loading = (data) => ({type: LOADING, payload: data});
